import { Component, Vue } from "vue-property-decorator";
import Menu from "./components/Menu.vue";

@Component({
  components: {
    Menu
  }
})
export default class App extends Vue {
    mounted() {
    this.$store.dispatch("loadSessionData");
    this.$store.dispatch("loadSpeakerData");
  }
}
